CREATE TRIGGER sprawdzanie_czy_zchodzacy_byl_w_turnieju BEFORE INSERT OR UPDATE ON zmiany
FOR EACH ROW EXECUTE PROCEDURE sprawdz_zchodzacego_zmiany();

